DROP TABLE IF EXISTS "authors";

CREATE TABLE "authors" (
  "id" bigint NOT NULL,
  "first_name" varchar(50) NOT NULL,
  "last_name" varchar(50) NOT NULL,
  "email" varchar(100) NOT NULL,
  "birthdate" date NOT NULL,
  "added" timestamp WITH TIME ZONE DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY ("id"),
  UNIQUE ("email")
);

CREATE SEQUENCE "author_sequence"
  INCREMENT 1
  MINVALUE 1
  MAXVALUE 9223372036854775807
  START 1
  CACHE 1;
  
ALTER SEQUENCE "author_sequence"
        OWNED BY authors.id
        ;
ALTER TABLE authors
        ALTER COLUMN id SET default nextval('author_sequence')
        ;



DROP TABLE IF EXISTS "posts";

CREATE TABLE "posts" (
  "id" bigint NOT NULL,
  "author_id" bigint NOT NULL,
  "title" varchar(255) NOT NULL,
  "description" varchar(500) NOT NULL,
  "content" text NOT NULL,
  "date" date NOT NULL,
  PRIMARY KEY ("id")
);

CREATE SEQUENCE "post_sequence"
  INCREMENT 1
  MINVALUE 1
  MAXVALUE 9223372036854775807
  START 1
  CACHE 1;
  
ALTER SEQUENCE "post_sequence"
        OWNED BY posts.id
        ;
ALTER TABLE posts
        ALTER COLUMN id SET default nextval('post_sequence')
        ;


ALTER TABLE posts ADD CONSTRAINT PF_AUTHOR_ID FOREIGN KEY (author_id) REFERENCES authors (id);
